-- Dumping structure for procedure clearinghouse.SP_LAT_LONG_SWAP
DROP PROCEDURE IF EXISTS `SP_LAT_LONG_SWAP`;
DELIMITER //
CREATE PROCEDURE `SP_LAT_LONG_SWAP`()
BEGIN

DECLARE done INT DEFAULT 0;
DECLARE V_Lat VARCHAR(100);
DECLARE V_Long VARCHAR(100);

/*Exception handling 

DECLARE EXIT HANDLER FOR SQLEXCEPTION
BEGIN
ROLLBACK;
SELECT 'An error has occurred and the stored procedure was terminated';
END;*/

DECLARE cur1 CURSOR
FOR
SELECT a.Latitude,a.Longitude
FROM address a
WHERE a.Latitude LIKE '-%';

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

OPEN cur1;
read_loop: LOOP

IF done THEN 

   LEAVE read_loop;
	
END IF ;

FETCH cur1 INTO V_Lat,V_Long;

UPDATE address a
SET a.Latitude = V_long ,a.Longitude = V_lat
WHERE a.Latitude = V_Lat
AND a.Longitude = V_Long;
	
END LOOP read_loop;

CLOSE cur1;

END//
DELIMITER ;

-- Dumping structure for procedure clearinghouse.SP_ProviderListWithNoTransactions
DROP PROCEDURE IF EXISTS `SP_ProviderListWithNoTransactions`;
DELIMITER //
CREATE PROCEDURE `SP_ProviderListWithNoTransactions`(
	IN `p_startdate` DATETIME,
	IN `p_enddate` DATETIME
)
BEGIN

SELECT distinct p.ProviderID  
FROM provider p  INNER JOIN user u
ON p.ProviderID = u.ProviderID
INNER JOIN userroles ur 
ON ur.user_UserID = u.UserID
WHERE p.providerid NOT IN 
(
SELECT DISTINCT a.providerid
FROM 
(
SELECT 
t.RequesterProviderID AS providerid
FROM tripticket t
INNER JOIN provider p ON t.RequesterProviderID = p.ProviderId

LEFT JOIN 
(
SELECT 
tc.ClaimantProviderID,tc.TripTicketID
FROM tripclaim tc
INNER JOIN provider p ON tc.ClaimantProviderID = p.ProviderId
) tt ON t.TripTicketID = tt.TripTicketID
WHERE t.UpdatedOn BETWEEN p_startdate AND p_enddate 
AND t.RequesterProviderID IS NOT NULL

UNION ALL

SELECT 
tt.ClaimantProviderid AS providerid
FROM tripticket t
INNER JOIN provider p ON t.RequesterProviderID = p.ProviderId
LEFT JOIN 
(
SELECT 
tc.ClaimantProviderID ,tc.TripTicketID 
FROM tripclaim tc
INNER JOIN provider p ON tc.ClaimantProviderID = p.ProviderId
)tt ON t.TripTicketID = tt.TripTicketID
WHERE t.UpdatedOn BETWEEN p_startdate AND p_enddate
AND tt.ClaimantProviderid IS NOT NULL 
) a
)
AND ur.authority = 'ROLE_PROVIDERADMIN';

END//
DELIMITER ;

-- Dumping structure for procedure clearinghouse.SP_ProvidersWeeklyData
DROP PROCEDURE IF EXISTS `SP_ProvidersWeeklyData`;
DELIMITER //
CREATE PROCEDURE `SP_ProvidersWeeklyData`(
	IN `p_StartDate` DATETIME,
	IN `p_EndDate` DATETIME
)
BEGIN

SELECT
a.providerid,
a.ProviderAs,
a.TripTicketID,
DATE_FORMAT(a.DATE, "%m-%d-%Y %T") `Date`,
DATE_FORMAT(a.PickupDate, "%m-%d-%Y") PickupDate,
DATE_FORMAT(a.DropOffDate, "%m-%d-%Y") DropOffDate,
a.PickupTime PickupTime,
a.DropOffTime DropOffTime,
a.PickupAddress PickupAddress,
a.dropoffAddress DropoffAddress,
a.DISTANCE `Distance`,
a.Time `Time`,
a.ProposedFare ProposedFare ,
a.FundingSource `FundingSource`,
a.status `Status`
FROM
(
SELECT
t.RequesterProviderID AS providerid,
case when t.RequesterProviderID IS NOT NULL then 'Requester'
ELSE 'Claimant' END AS ProviderAs,
t.TripTicketID,
t.AddedOn `Date`,
t.RequestedPickupDate PickupDate,
t.RequestedDropOffDate DropOffDate,
t.RequestedPickupTime PickupTime,
t.RequestedDropOffTime DropOffTime,
concat(pickup.Street1,' ',IFNULL(pickup.Street2,' '),' ',IFNULL(pickup.City,' '),' ',IFNULL(pickup.County,' '),' ' ,IFNULL(pickup.State,' '),' ',IFNULL(pickup.ZipCode,' '),' ') PickupAddress,
concat(dropoff.Street1,' ',IFNULL(dropoff.Street2,' '),' ',IFNULL(dropoff.City,' '),' ',IFNULL(dropoff.County,' '),' ' ,IFNULL(dropoff.State,' '),' ',IFNULL(dropoff.ZipCode,' '),' ') dropoffAddress,
td.TripTicketDistance `Distance`,
td.TimeInString `Time`,
tt.ProposedFare ProposedFare ,
t.TripFunders `FundingSource`,
t.ApprovedTripClaimID,
-- s.`Type` AS `Status`
case when tt.TYPE = 'Pending' then 'Pending Your Approval'
when s.`Type` = 'No Show' then 'Cancelled'
ELSE s.`Type` end AS `Status`
FROM tripticket t INNER JOIN Provider p
ON t.RequesterProviderID = p.ProviderId
INNER JOIN address pickup
ON t.PickupAddressID = pickup.AddressID
INNER JOIN address dropoff
ON t.DropOffAddressID = dropoff.AddressID
INNER JOIN `status` s
ON t.statusid = s.StatusID
LEFT JOIN tripticketdistance td
ON t.TripTicketID = td.TripTicketId
LEFT JOIN
(
SELECT
tc.ClaimantProviderID,tc.TripTicketID,tc.ProposedFare,s.`Type`
from tripclaim tc INNER JOIN provider p
ON tc.ClaimantProviderID = p.ProviderId
INNER JOIN `status` s
ON s.statusid = tc.StatusID
AND tc.StatusID NOT IN (8)
) tt
ON t.TripTicketID = tt.TripTicketID
WHERE t.UpdatedOn BETWEEN p_StartDate AND p_EndDate
AND t.RequesterProviderID IS NOT NULL

UNION ALL

SELECT
tt.ClaimantProviderid AS providerid,
case when tt.ClaimantProviderid IS NOT NULL then 'Claimant'
ELSE 'Requester' END AS ProviderAs,
t.TripTicketID,
t.AddedOn `Date`,
t.RequestedPickupDate PickupDate,
t.RequestedDropOffDate DropOffDate,
t.RequestedPickupTime PickupTime,
t.RequestedDropOffTime DropOffTime,
concat(pickup.Street1,' ',IFNULL(pickup.Street2,' '),' ',IFNULL(pickup.City,' '),' ',IFNULL(pickup.County,' '),' ' ,IFNULL(pickup.State,' '),' ',IFNULL(pickup.ZipCode,' '),' ') PickupAddress,
concat(dropoff.Street1,' ',IFNULL(dropoff.Street2,' '),' ',IFNULL(dropoff.City,' '),' ',IFNULL(dropoff.County,' '),' ' ,IFNULL(dropoff.State,' '),' ',IFNULL(dropoff.ZipCode,' '),' ') dropoffAddress,
td.TripTicketDistance `Distance`,
td.TimeInString `Time`,
tt.ProposedFare ProposedFare ,
t.TripFunders `FundingSource`,
t.ApprovedTripClaimID,
tt.type `Status`
FROM tripticket t INNER JOIN Provider p
ON t.RequesterProviderID = p.ProviderId
INNER JOIN address pickup
ON t.PickupAddressID = pickup.AddressID
INNER JOIN address dropoff
ON t.DropOffAddressID = dropoff.AddressID
INNER JOIN `status` s
ON t.statusid = s.StatusID
LEFT JOIN tripticketdistance td
ON t.TripTicketID = td.TripTicketId
LEFT JOIN
(
SELECT
tc.ClaimantProviderID,tc.TripTicketID,tc.ProposedFare,s.`Type`
from tripclaim tc INNER JOIN provider p
ON tc.ClaimantProviderID = p.ProviderId
INNER JOIN `status` s
ON s.statusid = tc.StatusID
)tt
ON t.TripTicketID = tt.TripTicketID
WHERE t.UpdatedOn BETWEEN p_StartDate AND p_EndDate
AND tt.ClaimantProviderid IS NOT NULL
) a
ORDER BY a.ProviderID,a.Provideras Desc;

END//
DELIMITER ;

