DROP PROCEDURE IF EXISTS `sp_TripTicketwithServiceArea`;
DELIMITER //
CREATE PROCEDURE `sp_TripTicketwithServiceArea`(IN `P_ProviderId` INT)
BEGIN







SET @row_number = 0;

 

drop temporary table if exists tmp;



create temporary table tmp 

SELECT DISTINCT alltickets.tripticketid AS tripticketId,

(@row_number:=@row_number + 1) AS num



FROM   

(

select

-- Partner.ProviderID,

-- Partner.PartnerID,

t.tripticketid,

-- t.RequesterProviderID,

-- t.StatusID,

-- t.ApprovedTripClaimID,

-- t.PickupAddressID,

-- t.DropOffAddressID,

-- tc.ClaimantProviderID,

-- s.ServiceArea,

-- pick.Latitude as PickLat,

-- pick.Longitude as PickLon,

-- dropoff.Latitude as DropoffLat,

-- dropoff.Longitude as DropoffLon

-- `fn_IsPointInServiceLocation_new`(CONCAT('POLYGON((',s.ServiceArea,'))'), concat('POINT(',pick.Latitude,'',pick.Longitude,')')) as PickExist,

-- `fn_IsPointInServiceLocation_new`(CONCAT('POLYGON((',s.ServiceArea,'))'), concat('POINT(',dropoff.Latitude,'',dropoff.Longitude,')')) as DropExist

t.requestedpickupdate,

t.requestedpickuptime,

t.requesteddropoffdate,

t.requesteddropofftime,

(CASE WHEN t.StatusID=2 THEN 1 Else 2 END) as SortOrder

FROM       (

SELECT (

CASE

WHEN p.requesterproviderid=P_ProviderId THEN p.coordinatorproviderid

ELSE p.requesterproviderid

END )AS partnerid,

5    AS providerid

FROM   providerpartner p

WHERE  p.requeststatusid=2

AND    p.isactive=1

AND   (

p.requesterproviderid=P_ProviderId

OR     p.coordinatorproviderid=P_ProviderId) ) AS partner

INNER JOIN tripticket t

ON         t.requesterproviderid=partner.partnerid

AND        t.statusid<>9

LEFT JOIN  tripclaim tc

ON         tc.tripticketid=t.tripticketid

INNER JOIN address pick

ON         pick.addressid=t.pickupaddressid

INNER JOIN address dropoff

ON         dropoff.addressid=t.dropoffaddressid

INNER JOIN service s

ON         s.providerid=partner.providerid

AND        s.isactive=1

WHERE      ((

t.approvedtripclaimid IS NULL)

OR         (

tc.claimantproviderid=P_ProviderId))

AND tc.StatusID NOT IN(4,8)

-- 4 = Cancelled, 8=Declined

AND        (

`fn_ispointinservicelocation_new`(concat('POLYGON((',s.servicearea,'))'), concat('POINT(',pick.latitude,'',pick.longitude,')'))=1

AND        `fn_ispointinservicelocation_new`(concat('POLYGON((',s.servicearea,'))'), concat('POINT(',dropoff.latitude,'',dropoff.longitude,')'))=1)



UNION 



SELECT   t.tripticketid,

t.requestedpickupdate,

t.requestedpickuptime,

t.requesteddropoffdate,

t.requesteddropofftime,

2 as SortOrder

FROM     tripticket t

WHERE    t.requesterproviderid=P_ProviderId

ORDER BY SortOrder ASC,

isnull(requestedpickupdate),

requestedpickupdate ASC ,

isnull(requestedpickuptime),

requestedpickuptime ASC,

requesteddropoffdate ASC,

requesteddropofftime 

) alltickets;



Select 'Data Inserted Into Temp Table Successfully';





END//
DELIMITER ;

