CREATE FUNCTION `fn_IsPointInServiceLocation_new`(
	`ServiceArea` LONGTEXT,
	`AddressPoint` VARCHAR(1000)
) RETURNS tinyint(1)
    DETERMINISTIC
BEGIN
DECLARE g1 geometry;
Declare g2 point;

SET g1 = GEOMFROMTEXT(ServiceArea);
SET g2 = GEOMFROMTEXT(AddressPoint);

SET @IsPointInservicLocation = if(ST_Contains(g1,g2), 1, 0);

RETURN @IsPointInservicLocation;
END//
